    padding-right: 400px;
    text-align: center;
    height: 100vh;
    margin-top: 150px;
    border: 1px solid black;
`;

class UserProfile extends React.Component {
    render( ){
        return(
            <PrettyProfile>Hello world</PrettyProfile>
        )
    }
}

export default UserProfile;
